        var view = {
            hideSeedInputBox: () => document.getElementsByTagName('input')[0].style.display = 'none',
            setFocusOnSeedInputBox: () => document.getElementsByTagName('input')[0].focus(),
            setWidthOfSeedInputBox: (width) => document.getElementsByTagName('input')[0].style.width = width,

            hideCodeInputBox: () => document.getElementsByTagName('input')[1].style.display = 'none',
            displayCodeInputBox: () => document.getElementsByTagName('input')[1].style.display = 'inline',
            setFocusOnCodeInputBox: () => document.getElementsByTagName('input')[1].focus(),
            setWidthOfCodeInputBox: (width) => document.getElementsByTagName('input')[1].style.width = width,

            displayCode: (code) => {
                if (model.codes[code] != undefined)
                    document.getElementsByTagName('span')[0].textContent = model.codes[code];
                else
                    document.getElementsByTagName('span')[0].textContent = '';
            },


            init: () => {
                controller.setPageLoadedEvent();
            }
        };

        var controller = {
            setPageLoadedEvent: () => document.addEventListener('DOMContentLoaded', () => {
                controller.setChangeEventHandlerOfSeedInputBox();
                controller.setInputEventHendlerOfCodeInputBox();
                view.hideCodeInputBox();
                view.setFocusOnSeedInputBox();
                view.setWidthOfSeedInputBox("52px");
                view.setWidthOfCodeInputBox("25px");
            }, false),

            setChangeEventHandlerOfSeedInputBox: () => document.getElementsByTagName('input')[0].onchange = controller.changeEventHandlerOfSeedInputBox,

            setInputEventHendlerOfCodeInputBox: () => document.getElementsByTagName('input')[1].oninput = controller.inputEventHandlerOfCodeInputBox,

            changeEventHandlerOfSeedInputBox: (event) => {
                model.seed = event.target.value;
                view.hideSeedInputBox();
                view.displayCodeInputBox();
                view.setFocusOnCodeInputBox();
            },

            inputEventHandlerOfCodeInputBox: (event) => {
                model.code = model.sha256(model.seed + event.target.value).then(res => view.displayCode('z' + res));
            }
        };

        view.init();
